import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importa el archivo CSS de Bootstrap
import { Navbar, Nav, NavDropdown } from 'react-bootstrap'; // Importa los componentes de Bootstrap que necesitas
import { Link } from 'react-router-dom'; 
import './css/Usuarios.css'; // Asegúrate de crear este archivo para tus estilos personalizados

function Usuarios() {
  return (
    <div className="app">
      <Navbar bg="white" variant="dark" expand="lg" fixed="top">
        <Nav className="ml-auto justify-content-end">
          <NavDropdown title={
            <svg xmlns="http://www.w3.org/2000/svg" width="54" height="54" fill="currentColor" className="bi bi-person-circle" viewBox="0 0 16 16">
              <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
              <path fillRule="evenodd" d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1" />
            </svg>
          } id="user-menu" alignRight>
            <NavDropdown.Item as={Link} to="/menu">Menu</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item as={Link} to="/">Sign out</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar>
      <div className="content">
        <h1>Contenido Principal</h1>
        {/* Aquí puedes añadir más contenido */}
      </div>
    </div>
  );
}

export default Usuarios;
